// @flow

import test from "ava";
import nock from "nock";
import { findPodcastRssUrl } from "./findPodcastRssUrl";

test.serial.beforeEach(() => {
  // $FlowFixMe
  nock("https://geekonomy.net:443", { encodedQueryParams: true })
    .get("/")
    .reply(
      200,
      [
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
      ],
      [
        "Server",
        "nginx",
        "Date",
        "Sat, 01 Apr 2017 14:53:45 GMT",
        "Content-Type",
        "text/html; charset=UTF-8",
        "Transfer-Encoding",
        "chunked",
        "Connection",
        "close",
        "Strict-Transport-Security",
        "max-age=86400",
        "Vary",
        "Accept-Encoding",
        "Vary",
        "Cookie",
        "X-hacker",
        "If you're reading this, you should visit automattic.com/jobs and apply to join the fun, mention this header.",
        "Link",
        "<http://wp.me/6r3sH>; rel=shortlink",
        "Content-Encoding",
        "gzip",
        "X-ac",
        "3.lhr _dfw",
      ],
    );
});

test.serial.afterEach.always(() => {
  nock.cleanAll();
});

test.serial("Find RSS URL by top level domain", async t => {
  const url = await findPodcastRssUrl("https://geekonomy.net/");
  t.is(url, "https://geekonomy.net/feed/");
});

test.serial("Find RSS URL by non-top level domain", async t => {
  const url = await findPodcastRssUrl("https://geekonomy.net/blah-blah/");
  t.is(url, "https://geekonomy.net/feed/");
});
